import ExpenseItem from "./ExpenseItem";
import Card from "./Card";
import ExpenseFilter from "./ExpenseFilter";

function Expenses(props) {
  const filterChangeHandeler = (year) => {
    props.data.filter((expenseData) => expenseData.date.getYear() == year);
  };
  return (
    <Card className="expenses">
      <ExpenseFilter onFilterChange={filterChangeHandeler} />
      {props.data.map((expenseData) => (
        <ExpenseItem data={expenseData} key={expenseData.id} />
      ))}
    </Card>
  );
}

export default Expenses;
